import { Card, Container } from '@material-ui/core';
import React, { useEffect, useState } from 'react';
import ReactMarkdown from 'react-markdown';
import CodeBlock from '../CodeBlock';
import Page from '../Page';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { color } from '@mui/system';
import axios from 'axios';

function createData(
    name,
    calories,
    fat,
    carbs,
    protein,
  ) {
    return { name, calories, fat, carbs, protein };
  }

  const API_KEY = "?api_key=" + "RGAPI-6a96a8f8-d021-4f81-8828-898ab358a5fd";
  var a;
  function searchPlayer(player) {
    var APICall = "https://euw1.api.riotgames.com/lol/summoner/v4/summoners/by-name/" + player + API_KEY;
    axios.get(APICall).then(function (r) {
    console.log(r);
    a =r.data;
    a = a.id;
    console.log(a);
    }).catch (function(e) {
        getPlayerDatas(a);
    }).then ( function (re) {

    }

    )

  }

  function getPlayerDatas(player) {
    var APICall = "https://euw1.api.riotgames.com/lol/league/v4/entries/by-summoner/" + player + API_KEY;
    axios.get(APICall).then(function (r) {
        console.log(r);
        }).catch (function(e) {
            console.log(e);
        })
  }

  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9), 
  ];
export default function Home() {
    const [terms, setTerms] = useState()
    const termsFrPath = require("../../README.md");
    useEffect(() => {
       /* fetch(termsFrPath).then((response) => response.text()).then((text) => {
            setTerms(text)
        })
        console.log(terms)*/
    });

    return (
        <Page title="Ranking">
                <Container>
                    <div><ReactMarkdown source={terms} renderers={{ code: CodeBlock }} /></div>
                    <TableContainer component={Paper} >
      <Table sx={{ minWidth: 650 ,bgcolor: '#2F4F4F'}} aria-label="simple table">
        <TableHead>
          <TableRow >
            <TableCell sx={{ color: 'white'}}>Player</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Summoner Name</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Rank</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">W</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">L</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">WR</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
        <div>{searchPlayer("anxhanna")}</div>
        {getPlayerDatas({a})}
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ 'td, th': { border: 0, color: 'white' } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>

          ))}
        </TableBody>
      </Table>
    </TableContainer>

                </Container>
        </Page>
    )
}
